const isEligible = Promise.resolve(1);



async function loadAndRunExperiment() {

  // Import external sources 
  for (const script of scriptArray) {await load_script(script)}

  // Initialize jsPsych
  var jsPsych = initJsPsych({
    show_progress_bar: true,
    on_close: function(e){
      e.preventDefault();
      e.returnValue = '';
    },
  });

  // Get all functions of experiment.js into the "expeFunctions" obj
  const expeFunctions = await import("https://cdn.jsdelivr.net/gh/FranckPrts/four-in-a-row-MaLab@latest/modules/experiment.js");

  // Run through the original experiment workflow
  isEligible.then((result) => {
    if (typeof chrome === "object"){
      if (result != null){
          if (result == true){
            expeFunctions.create_timeline(timeline)
            // run experiment
            jsPsych.run(timeline)
          } else{
            timeline.push(ineligible)
            // run experiment
            jsPsych.run(timeline)
          }
      } else {
        expeFunctions.create_timeline(timeline)
        // run experiment
        jsPsych.run(timeline)
      }
    } else {
      timeline.push(browser_wrong)
      // run experiment
      jsPsych.run(timeline)
    }
  })
}

loadAndRunExperiment()

